import React from "react";
import { useGlobalContext } from "./context";

const Movies = () => {
     const { movies } = useGlobalContext();
     return (
          <>
               {movies.map((curMovie) => {
                    return <h2>curMovie.title</h2>;
               })}
          </>
     );
};

export default Movies;
